import { useState, useEffect } from 'react';


function Card (){

    const [data, setDate] = useState(null);  

    useEffect(() => {
        fetch('https://jsonplaceholder.typicode.com/users/')
            .then(response => response.json())
            .then(data => setDate(data))
            .catch(error => console.log(error));
    }, []);

